import React from "react";

function PersonList({ people }) {
  return (
    <div>
      <h2>Lista de Pessoas</h2>
      <ul>
        {people.map((person) => (
          <li key={person.id}>
            <p>{person.name}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PersonList;
